This PR was created automatically by the OpenMCP bot in response to someone submitting an OpenAPI spec on https://www.open-mcp.org/.

It adds support for a new MCP server `api_weather_gov`.

## Installing

Once this PR is merged the server will be available as an npm package called `@open-mcp/api_weather_gov`, which you'll be able to add to your MCP client config like this:

```json
{
  "mcpServers": {
    "api_weather_gov": {
      "command": "npx",
      "args": ["-y", "@open-mcp/api_weather_gov"],
    }
  }
}
```

In the meantime you can pull this branch to install and build the server manually.

## Beta warning

This is an early beta so some things won't work as expected, but we're working fast and confident that most edge cases will be ironed out soon.
